import React from 'react';

const Introduction = () => {
	return (
		<G>
			<h1 className='landing-content-heading'>تایپ آنلاین، به‌صرفه!</h1>
			<p className='landing-content-paragraph'>
				تیزتایپ همواره در تلاش است تا بهترین تجربه‌ی سفارش، انجام و تحویل پروژه‌های تایپ بصورت آنلاین را برای شما به
				ارمغان بیاورد.
			</p>
		</G>
	);
};

export default Introduction;
